CoolspotFont::CoolspotFont()
{
   // init position
   memset(char_position_, 0, sizeof char_position_);

   int pos = 0;
   int char_index = coolspot_font.first_ascii;
   char_position_[char_index++] = 0;
   while (pos < coolspot_font.width*coolspot_font.bytes_per_pixel && char_index < 0x100)
   {
      bool newchar = true;
      for (int i = 0; i < coolspot_font.bytes_per_pixel; i++)
      {
         if (coolspot_font.pixel_data[pos + i] != 0xFF)
         {
            newchar = false;
         }
      }
      if (newchar)
      {
         char_position_[char_index++] = pos;
      }
      
      pos+= coolspot_font.bytes_per_pixel;
   }
}

CoolspotFont::~CoolspotFont()
{

}

void CoolspotFont::CopyLetter(char c, int line, int* buffer, CLogger* logger)
{
   int display_x = 0;
   int offset = char_position_[c] + (coolspot_font.bytes_per_pixel * line * coolspot_font.width) + coolspot_font.bytes_per_pixel;
   int endoffset = char_position_[c+1] + (coolspot_font.bytes_per_pixel * line * coolspot_font.width);

   unsigned char* col_buffer = (unsigned char*)buffer;

   while (offset < endoffset)
   {
      if (coolspot_font.pixel_data[offset + 3] != 0)
      {
         for (int col = 0; col < coolspot_font.bytes_per_pixel; col++)
         {
            col_buffer[col] = coolspot_font.pixel_data[offset + col];
         }
      }
      col_buffer += sizeof(int);
      offset += coolspot_font.bytes_per_pixel;
      display_x++;
   }
}

int CoolspotFont::GetLetterLength(char c)
{
   if (c < 0xFF)
   {
      return (char_position_[c + 1] - (char_position_[c]))/ coolspot_font.bytes_per_pixel - 1;
   }
   else
   {
      return (coolspot_font.width * coolspot_font.bytes_per_pixel - (char_position_[c]))/ coolspot_font.bytes_per_pixel - 1;
   }
   
}

int CoolspotFont::GetLetterHeight(char c)
{
   return coolspot_font.height;
}
